import { Injectable } from '@angular/core';
import { IrmFoie } from '../models/IrmFoie';
import { HttpClient, HttpHeaders, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class IrmfoieService {
  private apiUrl = 'https://localhost:7129/api/Irmfoies';

  constructor(private http: HttpClient) { }
  addIrmfoie(IrmFoie: IrmFoie): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', IrmFoie);

    return this.http.post<any>(`${this.apiUrl}/addIrmfoie`, IrmFoie, { observe: 'response' });
  }

  
  getIrmFoieById(PatientId: number): Observable<IrmFoie> {
    return this.http.get<IrmFoie>(`${this.apiUrl}/${PatientId}`);
  }

  update(PatientID: number, irmFoie: IrmFoie): Observable<any> {
    return this.http.put(`${this.apiUrl}/update/${PatientID}`, irmFoie, {
      headers: new HttpHeaders({
        'Content-Type': 'application/json'
      })
    });
  }
}
